import axios from "axios";
import { useEffect, useState } from "react"
import { useNavigate, useParams } from "react-router-dom"

const URI = 'http://localhost:8000/createDireccion/'
const idURI = 'http://localhost:8000/oneDireccion/'

const CompCreateDireccion = () => {
    const navigate = useNavigate()
    const [Calle, setCalle] = useState('');
    const [Numero, setNumero] = useState('');
    const [Alcaldia, setAlcaldia] = useState('');
    const [Codigo_Postal, setCodigoPostal] = useState('');
    const [Coordenadas, setCoordenadas] = useState('');
    const [Referencias, setReferencias] = useState('');
    const [Entre_Calle_1, setEntreCalle1] = useState('');
    const [Entre_Calle_2, setEntreCalle2] = useState('');
    const alcaldiasCDMX = [
        'Álvaro Obregón',
        'Azcapotzalco',
        'Benito Juárez',
        'Coyoacán',
        'Cuajimalpa de Morelos',
        'Cuauhtémoc',
        'Gustavo A. Madero',
        'Iztacalco',
        'Iztapalapa',
        'Magdalena Contreras',
        'Miguel Hidalgo',
        'Milpa Alta',
        'Tláhuac',
        'Tlalpan',
        'Venustiano Carranza',
        'Xochimilco'
      ];
    //Procedimiento para actualizar
    const store = async (e) => {
        e.preventDefault()
        //en este caso pasamos la URI mas la id, justo como se hizo en las pruebas con thunderclient
        try{
            const response = await axios.post(URI, {
                Calle: Calle, Numero: Numero, Alcaldia: Alcaldia,
                    Codigo_Postal: Codigo_Postal, Coordenadas: Coordenadas, Referencias: Referencias, Entre_Calle_1: Entre_Calle_1,
                    Entre_Calle_2: Entre_Calle_2       
                })
                navigate('/') //Regresamos al principio
                            // Verifica si la solicitud fue exitosa
            if (response.status === 201) {
                // Si es exitosa, obtén el ID de la dirección recién creada
                const idResponse = await axios.get(idURI+ response.data.ID_Direccion);
                const id = idResponse.data.ID_Direccion;

                console.log("ID_Direccion:", id);

                navigate('/');
            }
            } catch (error) {
                console.error("Error al crear la dirección:", error);
            }
    }


    const handleAlcaldiaChange = (e) => {
        const selectedOption = e.target.options[e.target.selectedIndex];
        const selectedAlcaldia = selectedOption.innerText;
        setAlcaldia(selectedAlcaldia);
    };

    return (
        <div className="formulario">
            <h1>Ingresar nuevo deportivo: 
                Dirección</h1>
            <form onSubmit={store}>
                <div className="form-group">
                    <label>Calle</label>
                    <input type="text" value={Calle} onChange={(e) => setCalle(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Número</label>
                    <input type="text" value={Numero} onChange={(e) => setNumero(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                <label>Alcaldía</label>
                <select value={Alcaldia} onChange={handleAlcaldiaChange}>
                    {alcaldiasCDMX.map((alcaldia, index) => (
                        <option key={index} value={alcaldia}>{alcaldia}</option>
                    ))}
                </select>
                </div>
                <div className="form-group">
                    <label>Código Postal</label>
                    <input type="text" value={Codigo_Postal} onChange={(e) => setCodigoPostal(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Coordenadas</label>
                    <input type="text" value={Coordenadas} onChange={(e) => setCoordenadas(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Referencias</label>
                    <input type="text" value={Referencias} onChange={(e) => setReferencias(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Entre Calle 1</label>
                    <input type="text" value={Entre_Calle_1} onChange={(e) => setEntreCalle1(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Entre Calle 2</label>
                    <input type="text" value={Entre_Calle_2} onChange={(e) => setEntreCalle2(e.target.value)} className="form-control" />
                </div>
                <button type="submit" className="btn btn-primary">Ingresar dirección</button>
            </form>
        </div>
    )
}


export default CompCreateDireccion
